import React, { Component } from 'react';
import PropTypes from 'prop-types';

const HomeCard = (children) => {
	return <div className="card" >{children}</div>
}

class Home extends Component {

	render() {
	    return (<div className="Home">
	    	<HomeCard>
	    		<input type="text" />
	    	</HomeCard>
	    </div>);
	}
}

Home.propTypes = {
}

export default Home;
